import React from "react";
import './sobre.css';
import imgSobre1 from '../../assets/images/sobre1.jpeg'

function Sobre() {
    return (
        <section className="sobre">
            <div className="sobre-item">
                <img src={imgSobre1} alt="" className="imagem-sobre"/>
                <div className="texto-sobre">
                    <h2>Título do Primeiro Texto</h2>
                    <p>Texto explicativo sobre o primeiro item. Detalhes e informações relevantes para o usuário.</p>
                </div>
            </div>
            <div className="sobre-item">
                <img src="caminho-da-imagem2.jpg" alt="Descrição da Imagem 2" className="imagem-sobre"/>
                <div className="texto-sobre">
                    <h2>Título do Segundo Texto</h2>
                    <p>Texto explicativo sobre o segundo item. Detalhes e informações adicionais para o usuário.</p>
                </div>
            </div>
        </section>
    );
}

export default Sobre;
